@CarloCalenda Carlo, facciamo così anche col Servizio Sanitario Nazionale e negli anni ‘70 si diceva: “pagheremo il medico ai miliardari?” 
Torneresti indietro? 
Serve un fisco maggiormente progressivo, e un welfare davvero universale. Su borse di studio e alloggi sono d’accordo, l'ho scritto.

